import React from 'react';

const Game = ({ selectedLanguage }) => {
  return (
    <div className="TOP">
      {/* Header */}
      <header className="header_EU">
        {/* ... same as your HTML, adjusted for React syntax */}
        <div className="col right-section-EU text-end">
          {/* ... other links */}
          <div className="language-switcher d-inline-block">
            <a href="#" className={`language-link ${selectedLanguage === 'en' ? 'selected' : ''}`} data-lang="en">ENG</a>
            <span className="language-divider"> / </span>
            <a href="#" className={`language-link ${selectedLanguage === 'es' ? 'selected' : ''}`} data-lang="es">ESP</a>
          </div>
          {/* ... other links */}
        </div>
      </header>

      {/* Main Content */}
      <div className="container mt-5">
        <div className="row justify-content-center">
          <div className="col-md-10">
            <div className="embed-responsive embed-responsive-16by9 shadow-lg rounded">
              <iframe className="embed-responsive-item" src="path_to_your_game_embed_url" allowFullScreen></iframe>
            </div>
          </div>
        </div>
      </div>

      {/* Footer */}
      <footer className="py-4 bg-dark text-white mt-5">
        <div className="container">
          <p className="m-0 text-center">&copy; 2022 Energy & U. All Rights Reserved.</p>
        </div>
      </footer>
    </div>
  );
}

export default Game;
